private static boolean containsDefaultSwitch(DetailAST caseGroupAst) {
    DetailAST nextAst = caseGroupAst;
    boolean found = false;

    while (nextAst != null) {
        if (nextAst.findFirstToken(TokenTypes.LITERAL_DEFAULT) != null) {
            found = true;
            break;
        }

        nextAst = nextAst.getNextSibling();
    }

    return found;
}
